import React, { useState, useContext, useEffect } from 'react'
import GlobalStoreContext from '../store'
import ListCard from './ListCard.js'
import YouTubePlayerExample from '../YouTubePlaylisterReact-main/src/PlaylisterYouTubePlayer.js'
import MUIDeleteModal from './MUIDeleteModal'
import HomeIcon from '@mui/icons-material/HomeOutlined';
import Person from '@mui/icons-material/PersonOutline';
import People from '@mui/icons-material/Groups';
import SearchBar from '@mui/material/TextField';
import Typography from '@mui/material/Typography';
import {Tabs, Tab} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import Fab from '@mui/material/Fab'
import List from '@mui/material/List';
import Box from '@mui/material/Box'
import MenuIcon from '@mui/icons-material/Menu';
import FastForwardIcon from '@mui/icons-material/FastForward';
import FastRewindIcon from '@mui/icons-material/FastRewind';
import PauseIcon from '@mui/icons-material/Pause';
import PlayArrowIcon from '@mui/icons-material/PlayArrow';
/*
    This React component lists all the top5 lists in the UI.

    @author McKilla Gorilla
*/
const HomeScreen = () => {

    const { store } = useContext(GlobalStoreContext);

    let player;
    document.getElementById("player").click();
    function handlePlayerClick(event) {
        player = event;
    }

    useEffect(() => {
        store.loadIdNamePairs();
    }, []);

    function handleCreateNewList() {
        store.createNewList();
    }
    let listCard = "";
    if (store) {
        listCard = 
            <List sx={{bgcolor:"pink", width: '50%', overflow: "scroll"}}>
            {
                store.idNamePairs.map((pair) => (
                    <ListCard
                        key={pair._id}
                        idNamePair={pair}
                        selected={false}
                    />
                ))

            }
            </List>;
    }
    //Tab stuff
    const [value, setValue] = useState(0);

    const handleTabs=(event, value)=>{
        console.warn(value);
        setValue(value);
    }

    //Player stuff

    const handlePrevSong = () => {

    }
    const handlePauseSong = (event) => {
        player.pauseVideo();
    }
    const handlePlaySong = () => {

    }
    const handleNextSong = () => {

    }

    return (
        <Box sx={{height:"94%", width: "100%", bgcolor:"green"}}>
            <Box sx={{width:"100%", height:"8%"}}>
                <HomeIcon sx={{border:1, mt:"0.2%", ml:"1.1%",fontSize:"60px", color:"white"}}></HomeIcon>
                <People sx={{ml:"1%", mt:"0.2%",fontSize:"60px", color:"white"}}></People>
                <Person sx={{ml:"1%", mt:"0.2%",fontSize:"60px", color:"white"}}></Person>
                <SearchBar sx={{ml:"5%", mt:"0.5%", bgcolor:"white", width:"40%", color:"red"}} label="Search" variant="outlined" />
                <Typography display="inline" sx={{ml:"30%",fontSize:"20px"}}>Sort By</Typography>
                <MenuIcon sx={{ml:"2%",fontSize:"60px", color:"black"}}></MenuIcon>
            </Box>
            <Box sx={{ml:"2%", mr:"2%",  bgcolor:"blue"}} >
                <Box sx={{width:"112vw", height: "75vh", display: "flex", direction: "column", overflow: "scroll"}}>
                    {listCard}
                    <Box sx={{height:"6.5%", width:"40vw", bgcolor:"purple"}}>
                        <Tabs onChange={handleTabs} value = {value}>
                            <Tab sx={{bgcolor:"grey", borderRadius:"30%"}} label='Player'/>
                            <Tab sx={{bgcolor:"grey", borderRadius:"30%"}} label='Comments'/>
                        </Tabs>
                        <TabPanel value={value} index={0}>
                            <Box sx={{width:"100%", transform:"translate(0%,-5%)"}} bgcolor="white">
                                <Box sx={{transform:"translate(2.5%,1%)"}}>
                                    <YouTubePlayerExample onClick={handlePlayerClick} id="player"></YouTubePlayerExample>
                                </Box>
                                <Typography sx={{ml:"40%", fontSize:25}}>Now Playing</Typography>
                                <Typography sx={{ml:"20px", fontSize:25}}>{"Playlist: "}</Typography>
                                <Typography sx={{ml:"20px", fontSize:25}}>{"Song #: "}</Typography>
                                <Typography sx={{ml:"20px", fontSize:25}}>{"Title:   "}</Typography>
                                <Typography sx={{ml:"20px", fontSize:25}}>{"Artist:   "}</Typography>
                                <Box sx={{border:2, height:"75px", borderColor:"black", borderRadius:5, ml:"3%", width:"94%", bgcolor:"lightblue", fontSize:"75px"}}>
                                    <FastRewindIcon onClick={handlePrevSong} sx={{ml: "30%"}} fontSize="inherit"></FastRewindIcon>
                                    <PauseIcon onClick={handlePauseSong} fontSize="inherit"></PauseIcon>
                                    <PlayArrowIcon onClick={handlePlaySong} fontSize="inherit"></PlayArrowIcon>
                                    <FastForwardIcon onClick={handleNextSong} fontSize="inherit"></FastForwardIcon>
                                </Box>
                                <Box sx={{height: "10px", bgcolor:"inherit"}}></Box>
                            </Box>
                        </TabPanel>
                        <TabPanel value={value} index={1}>
                            <Box sx={{height: "1000%", width:"100%", mt:"10px", ml:"10px"}} bgcolor="white">
                                <SearchBar sx={{borderRadius:"20%", mt:"20%", bgcolor:"white", width:"95%", color:"red"}} label="Add Comment" variant="outlined" />
                            </Box>
                        </TabPanel>
                    </Box>
                </Box>
                <MUIDeleteModal />
            </Box>
            <Box sx={{transform:"translate(0%, -12%)", height:"125px", bgcolor:"orange"}}>
                <Fab sx={{mt:"1.5%", ml:"40%", bgcolor:"transparent"}} color="primary"  aria-label="add"  id="add-list-button" onClick={handleCreateNewList}>
                    <AddIcon sx={{color:"black", fontSize:"70px"}}/>
                </Fab>
                <Typography sx={{fontSize:70, ml:"40%"}}>Your Lists</Typography>
            </Box>
        </Box>
    );
}
export default HomeScreen;

function TabPanel(props){
    const {children, value, index} = props;
    return(
    <div>
        {
            value===index  && (
                <h1>{children}</h1>
            )
        }
    </div>
    )
}
